var resultArr = [];

// Load crossed entries from Firestore
async function loadCrossedEntries() {
    try {
        const snapshot = await db.collection('crossedEntries').get();
        snapshot.forEach(doc => {
            const data = doc.data();
            const crossedText = data.text;
            const rows = tab_results.children;
            for (var i = 0; i < rows.length; i++) {
                if (crossedText === rows[i].children[0].innerText.trim()) {
                    rows[i].children[0].classList.add("crossed");
                }
            }
        });
    } catch (error) {
        console.error("Error loading crossed entries: ", error);
    }
}

// Save crossed entry to Firestore
async function saveCrossedEntry(text) {
    await db.collection('crossedEntries').add({ text: text });
}

// Remove crossed entry from Firestore
async function removeCrossedEntry(text) {
    const snapshot = await db.collection('crossedEntries').where("text", "==", text).get();
    snapshot.forEach(doc => {
        doc.ref.delete();
    });
}

function show() {
    tab_results.innerHTML = "";
    resultArr = [];
    const str = name_input.value.toLowerCase().replace(/[^a-zA-Z0-9 ]/g, ""); // Clean input

    if (str.length > 2) {
        for (let i = 0; i < arr1.length; i++) {
            if (arr1[i].toLowerCase().includes(str)) {
                resultArr.push(arr2[i]);
            }
        }
        if (resultArr.length === 0) {
            tab_results.innerHTML = "<tr><td>Aucun résultat ...<br><span style='font-size:1em'>🙀</span><br>Essaie encore !<br><span style='font-size:1em'>😻</span></td></tr>";
        } else {
            for (const entry of resultArr) {
                const row = document.createElement("tr");
                const cell = document.createElement("td");
                cell.innerHTML = entry;

                // Check if the entry is crossed
                if (document.querySelector(`.crossed[innertext="${entry}"]`)) {
                    cell.classList.add("crossed");
                }

                cell.onclick = async function() {
                    const cellText = this.innerText.trim();
                    this.classList.toggle("crossed");
                    try {
                        if (this.classList.contains("crossed")) {
                            await saveCrossedEntry(cellText);
                        } else {
                            await removeCrossedEntry(cellText);
                        }
                    } catch (error) {
                        console.error("Error during cell click handling: ", error);
                    }
                };

                row.appendChild(cell);
                tab_results.appendChild(row);
            }
        }
    }
}

name_input.onclick = function() {
    logo.style.display = "none";
    name_input.value = "";
    tab_results.innerHTML = "<tr><td>Recherche parmi " + arr1.length + " noms d'adhérents</td></tr>";
}

// Initialize related events
function init() {
    name_input.addEventListener("keyup", show);
    loadCrossedEntries();
}

// Call init when the document is loaded
document.addEventListener('DOMContentLoaded', init);